import React, { useState } from 'react';
import logo from '../../../images/tante-01.svg';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import DashboardIcon from '@material-ui/icons/Dashboard';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import HelpIcon from '@material-ui/icons/Help';
import profile from '../../../images/profile.svg';
import { NavLink, Link } from 'react-router-dom';

import './NavLinks.css';

const StyledMenu = withStyles({
  paper: {
    border: '1px solid #d3d4d5',
  },
})((props) => (
  <Menu
    elevation={0}
    getContentAnchorEl={null}
    anchorOrigin={{
      vertical: 'bottom',
      horizontal: 'center',
    }}
    transformOrigin={{
      vertical: 'top',
      horizontal: 'center',
    }}
    {...props}
  />
));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    '&:focus': {
      backgroundColor: theme.palette.primary.main,
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: theme.palette.common.white,
      },
    },
  },
}))(MenuItem);

const NavLinks = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <React.Fragment>
      <ul className='nav-links'>
        <li>
          <NavLink to='/home'>
            <img className='logo' src={logo} alt='logo' />
          </NavLink>
        </li>

        <li>
          <NavLink to='/home' exact className='color-active'>
            Home
          </NavLink>
        </li>

        <li>
          <NavLink to='/candidates' className='color-active'>
            Candidates
          </NavLink>
        </li>

        <li>
          <NavLink to='/cast' className='color-active'>
            Vote
          </NavLink>
        </li>

        <li>
          <NavLink to='/about' className='color-active'>
            About us
          </NavLink>
        </li>

        <li>
          <NavLink to='/about' className='color-active'>
            Our Service
          </NavLink>
        </li>

        <div>
          <Button
            style={{
              backgroundColor: 'transparent',
              borderRadius: '10%',
            }}
            aria-controls='customized-menu'
            aria-haspopup='true'
            variant='contained'
            onClick={handleClick}>
            <img className='image-profile' src={profile} alt='profile' />
          </Button>
          <StyledMenu
            id='customized-menu'
            anchorEl={anchorEl}
            keepMounted
            open={Boolean(anchorEl)}
            onClose={handleClose}>
            <Link to='/user/profile'>
              <StyledMenuItem onClick={handleClose}>
                <ListItemIcon>
                  <AccountCircleIcon fontSize='small' />
                </ListItemIcon>
                <ListItemText primary='PROFILE' />
              </StyledMenuItem>
            </Link>
            <Link to='/admin'>
              <StyledMenuItem onClick={handleClose}>
                <ListItemIcon>
                  <DashboardIcon fontSize='small' />
                </ListItemIcon>
                <ListItemText primary='DASHBOARD' />
              </StyledMenuItem>
            </Link>
            <Link to='/admin'>
              <StyledMenuItem onClick={handleClose}>
                <ListItemIcon>
                  <HelpIcon fontSize='small' />
                </ListItemIcon>
                <ListItemText primary='Q&A' />
              </StyledMenuItem>
            </Link>

            <StyledMenuItem>
              <ListItemIcon>
                <ExitToAppIcon fontSize='small' />
              </ListItemIcon>
              <ListItemText primary='LOGOUT' />
            </StyledMenuItem>
          </StyledMenu>
        </div>
      </ul>
    </React.Fragment>
  );
};

export default NavLinks;
